  false,\n\t\"url\": null,\n\t\"notes\": \"The objectives of this biotic inventory
  contribute greatly to the construction of a solid foundation for wet meadow management
  on the Refuge and the wildlife that it supports (e.g. Oregon spotted frog, a candidate
  T&E species).  Refuge management of this habitat type is very controversial and
  receives national attention.  The project develops a collaboration team including
  USFWS (Refuge and Regional Office staff), Natureserve, the Refugeu2019s Ecology
  Work Group, and Oregon Natural Heritage Program to classify dry/wet meadow habitat
  types that will serve as the cornerstone for creating the Malheur State-and-Transition
  Model as specified in Malheur CCP Objective 4a (which deals with issues pertaining
  to succession, phenology, etc.).   In addition, education/training and experience
  received by Refuge staff on NVCS protocols and methods will be shared with other
  refuges through the coordination of the zone biologist and Region 1 I&M Program.\",\n\t\"license_title\":
